import React from "react";

export const FeatureEngineering = () => {
  return (
    <div>
      <div style={{ textAlign: "left", paddingLeft: "235px", marginTop: "-140px" }}>
        <h5>Data and Features</h5>
        <p style={{ fontSize: "15px" }}>
        There are 10 key features that we have identified through our literature review, as well as dataset exploration, which are as follows:
        </p>
        <ul style={{ fontSize: "30px", paddingLeft: "70px", marginTop: "30px", maxWidth: "1200px" }}>
          <li style={{ wordWrap: "break-word" }}>Random Forest</li>
          <li style={{ wordWrap: "break-word" }}>XgBoost</li>
          <li style={{ wordWrap: "break-word" }}>Artificial Neural Network</li>
        </ul>
      </div>
    </div>
  );
};
